import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the price filter elements to be visible
    await page.waitForSelector('.price-filter', { timeout: 5000 });
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.waitForSelector('#maxPrice', { timeout: 5000 });

    // Fill in the minimum and maximum price
    await page.fill('#minPrice', '50');
    await page.fill('#maxPrice', '150');

    // Take a screenshot after filling the price range
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_entered.png'));

    // Click the "Apply" button
    await page.click('button.apply-filter');

    // Take a final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract the values to verify
    const minPriceValue = await page.inputValue('#minPrice');
    const maxPriceValue = await page.inputValue('#maxPrice');

    return {
      success: true,
      action: "Applied price range filter from 50 to 150.",
      extractedData: {
        minPrice: minPriceValue,
        maxPrice: maxPriceValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
